settings.colorFunction:
var speed = dsData[dsIndex]['Speed'];
if (typeof speed !== undefined) {
    var percent = (speed - 45)/85;
    if (percent < 0.5) {
        percent *=2*100; 
        return tinycolor.mix('green', 'yellow', amount = percent).toHexString();
    } else {
        percent = (percent - 0.5)*2*100;
        return tinycolor.mix('yellow', 'red', amount = percent).toHexString();
    }
}

settings.markerImageFunction:
var speed = dsData[dsIndex]['Speed'];
var res = {
    url: images[0],
    size: 55
};
if (typeof speed !== undefined) {
    var percent = (speed - 45)/85;
    var index = Math.min(2, Math.floor(3 * percent));
    res.url = images[index];
}
return res;

settings.labelFunction:
var vehicleType = dsData[dsIndex]['vehicleType'];
if (typeof vehicleType !== undefined) {
    if (vehicleType == "bus") {
        return '<span style="color:orange;">Bus: ${entityName}</span>';
    } else if (vehicleType == "car") {
        return '<span style="color:blue;">Car: ${entityName}</span>';
    }
}

settings.tooltipFunction:
var vehicleType = dsData[dsIndex]['vehicleType'];
if (typeof vehicleType !== undefined) {
    if (vehicleType == "bus") {
        return '<b>Bus: ${entityName}</b><br/><b>Bus route:</b> ${busRoute}<br/>';
    } else if (vehicleType == "car") {
        return '<b>Car: ${entityName}</b><br/><b>Current destination:</b> ${destination}<br/>';
    }
}

